import { useState, useEffect } from 'react';
import {
  Box,
  Button,
  Typography,
  Container,
  Paper,
  Divider,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  TextField,
} from '@mui/material';
import axios from 'axios';
import * as web3 from '@solana/web3.js';
import ConfigForm from './components/ConfigForm';
import { ConfigType } from './types';

const App = () => {
  const [mainWallet, setMainWallet] = useState<{ publicKey: string; balance: number } | null>(null);
  const [wallets, setWallets] = useState<any[]>([]);
  const [config, setConfig] = useState<ConfigType | null>(null);
  const [transactionLogs, setTransactionLogs] = useState<any[]>([]);
  const [fundAmount, setFundAmount] = useState('');

  useEffect(() => {
    const ws = new WebSocket('ws://131.153.227.56:3002');
    ws.onmessage = (event) => {
      const data = JSON.parse(event.data);
      if (data.type === 'mainWallet') setMainWallet(data.payload);
      if (data.type === 'wallets') setWallets(data.payload);
      if (data.type === 'config') setConfig(data.payload);
      if (data.type === 'transactionLogs') setTransactionLogs(data.payload);
    };
    ws.onclose = () => console.log('WebSocket disconnected');
    return () => ws.close();
  }, []);

  const fetchData = async () => {
    try {
      const [mainWalletRes, walletsRes, configRes, logsRes] = await Promise.all([
        axios.get('http://131.153.227.56:3001/api/main-wallet'),
        axios.get('http://131.153.227.56:3001/api/wallets'),
        axios.get('http://131.153.227.56:3001/api/config'),
        axios.get('http://131.153.227.56:3001/api/transaction-logs'),
      ]);
      setMainWallet(mainWalletRes.data);
      setWallets(walletsRes.data);
      setConfig(configRes.data);
      setTransactionLogs(logsRes.data);
      console.log('Main wallet response:', mainWalletRes.data);
    } catch (err) {
      console.error('Error fetching data:', err);
    }
  };

  const handleCreateWallets = async () => {
    try {
      await axios.post('http://131.153.227.56:3001/api/create-wallets', {}, { timeout: 30000 });
      await fetchData();
      alert('Wallets created');
    } catch (err) {
      console.error('Error creating wallets:', err);
      alert('Failed to create wallets: ' + (err as Error).message);
    }
  };

  const handleFundWallets = async () => {
    try {
      const amount = parseFloat(fundAmount);
      if (isNaN(amount) || amount <= 0) throw new Error('Invalid fund amount');
      await axios.post('http://131.153.227.56:3001/api/fund-wallets', { fundAmount: amount * web3.LAMPORTS_PER_SOL }, { timeout: 30000 });
      await fetchData();
      alert('Wallets funded');
    } catch (err) {
      console.error('Error funding wallets:', err);
      alert('Failed to fund wallets: ' + (err as Error).message);
    }
  };

  const handleRestoreSol = async () => {
    try {
      await axios.post('http://131.153.227.56:3001/api/restore-sol', {}, { timeout: 30000 });
      await fetchData();
      alert('SOL restored');
    } catch (err) {
      console.error('Error restoring SOL:', err);
      alert('Failed to restore SOL: ' + (err as Error).message);
    }
  };

  const handleConfigUpdate = async (newConfig: Partial<ConfigType>) => {
    try {
      await axios.post('http://131.153.227.56:3001/api/config', newConfig, { timeout: 30000 });
      await fetchData();
    } catch (err) {
      console.error('Error updating config:', err);
      throw err;
    }
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4 }}>
      <Paper elevation={3} sx={{ p: 4 }}>
        <Typography variant="h4" gutterBottom>
          Solana Trading Bot
        </Typography>
        <Box sx={{ mb: 4 }}>
          <Typography variant="h6">
            Main Wallet: {mainWallet?.publicKey || 'Loading...'}
          </Typography>
          <Typography variant="body1">
            Balance: {(mainWallet?.balance || 0) / web3.LAMPORTS_PER_SOL} SOL
          </Typography>
          <Button variant="contained" color="primary" onClick={fetchData} sx={{ mt: 2 }}>
            Refresh Balance
          </Button>
        </Box>
        <Divider sx={{ mb: 4 }} />
        <Box sx={{ mb: 4 }}>
          <Typography variant="h5" gutterBottom>
            Trading Configuration
          </Typography>
          <ConfigForm config={config} onConfigUpdate={handleConfigUpdate} />
        </Box>
        <Divider sx={{ mb: 4 }} />
        <Box sx={{ mb: 4 }}>
          <Typography variant="h5" gutterBottom>
            Wallet Management
          </Typography>
          <Box sx={{ display: 'flex', gap: 2, mb: 2 }}>
            <Button variant="contained" color="primary" onClick={handleCreateWallets}>
              Create Wallets
            </Button>
            <TextField
              label="Fund Amount (SOL)"
              value={fundAmount}
              onChange={(e: React.ChangeEvent<HTMLInputElement>) => setFundAmount(e.target.value)}
              type="number"
              inputProps={{ step: '0.001' }}
              sx={{ width: 150 }}
            />
            <Button variant="contained" color="primary" onClick={handleFundWallets}>
              Fund Wallets
            </Button>
            <Button variant="contained" color="secondary" onClick={handleRestoreSol}>
              Restore SOL
            </Button>
          </Box>
          {wallets.length > 0 && (
            <Table size="small">
              <TableHead>
                <TableRow>
                  <TableCell>Public Key</TableCell>
                  <TableCell>SOL Balance</TableCell>
                  <TableCell>Trade Status</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {wallets.map((wallet, index) => (
                  <TableRow key={index}>
                    <TableCell>{wallet.publicKey}</TableCell>
                    <TableCell>{wallet.solBalance / web3.LAMPORTS_PER_SOL} SOL</TableCell>
                    <TableCell>{wallet.tradeStatus}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          )}
        </Box>
        <Divider sx={{ mb: 4 }} />
        <Box>
          <Typography variant="h5" gutterBottom>
            Transaction Logs
          </Typography>
          {transactionLogs.length > 0 && (
            <Table size="small">
              <TableHead>
                <TableRow>
                  <TableCell>Wallet</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Details</TableCell>
                  <TableCell>Timestamp</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {transactionLogs.map((log, index) => (
                  <TableRow key={index}>
                    <TableCell>{log.wallet}</TableCell>
                    <TableCell>{log.type}</TableCell>
                    <TableCell>{log.status}</TableCell>
                    <TableCell>{log.details}</TableCell>
                    <TableCell>{log.timestamp}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          )}
        </Box>
      </Paper>
    </Container>
  );
};

export default App;
